  \"2013-03-15T10:25:13.676722\",\n\t\"name\": \"spatial-vegetation-data-for-sand-creek-massacre-national-historic-site-vegetation-mapping-proje\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"High resolution vegetation polygons mapped
  by the National Park Service. Multivariate ordination and clustering analyses were
  used to classify the vegetation. As a result, six plant associations of the National
  Vegetation Classification (NVC) were identified and locally described. To produce
  the vegetation map, both National Agriculture Imagery Program 1:12,000-scale, true
  color, digital ortho-imagery acquired in 2006 and the USDA-FSA-APFO Digital Ortho
  Mosaic for Kiowa County were used in conjunction with field data to identify vegetation
  signatures. Four additional non-natural mapping units were devised from the plot
  and observation point data to complete the map.\",\n\t\"license_title\": null,\n\t\"extras\":
